import React from 'react';

const Menu3 = () => {
  return (
    <section className='menu'>
      <div className='menu3'>
        <h2>The Best Car Insurance Companies for 2021</h2>
        <p>
          We looked at claims processes, transparency, complaints and more to
          find and rank the best car insurance companies.
        </p>
      </div>
    </section>
  );
};

export default Menu3;
